function handlerChange(e){
    e.preventDefault();
    dispatch(getByName(name));
}
    return
    <div> 
    <input type="text" placeholter ='Breed ...' onChange={e=>handlerChange(e)}></input>
    <button type='submit' onClick={e=>handleSubmit(e)} >Find</button> 
    </div>
    
}
